import {React} from 'react';
import {useDispatch} from 'react-redux';
import {changeColor} from '../products/productsSlice.js';

const ChangeColorItem=(props)=>{
    const dispatch=useDispatch();
    
    const changeColorButtons=props.variantsColor.map((element) =><button key={element.id} onClick={()=>dispatch(changeColor({id:props.id,color:element}))}>{element}</button>);
    console.log(changeColorButtons);
return(
    <>
    <div>
        {changeColorButtons}
    </div>
    
    </>


)

}

export default ChangeColorItem;
